import React from "react";
// import { Parallax } from "react-scroll-parallax";
import {
  ContactContainer,
  ContactInner,
  ContactText,
  ContactText1,
  ContactText2,
  ContactText3,
  ContactEmail,
  ContactLinkedIn,
  NavMail,
  Image,
} from "./ContactElements";
import { HiMail } from "react-icons/hi";

const Contact = () => {
  return (
    <ContactContainer id="contact">
      <ContactText1>Let's get in touch</ContactText1>
      <ContactText2>via and let’s discuss</ContactText2>
      <ContactText3>how I can help you.</ContactText3>
      <ContactText>
        Let's get in touch via and let’s discuss how I can help you.
      </ContactText>
      <ContactInner>
        <ContactEmail>
            <NavMail>
              <a className="lim" target="_blank" href="mailto:hashirizaki61@gmail.com">
                <HiMail />
              </a>
            </NavMail>
        </ContactEmail>
        <ContactLinkedIn>
          <a
            className="link"
            target="_blank"
            href="https://www.linkedin.com/in/yuya-hashirizaki-9b0065191/"
          >
            LinkedIn
          </a>
        </ContactLinkedIn>
      </ContactInner>
    </ContactContainer>
  );
};

export default Contact;
